import react,{Component} from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router,Link,Switch,Route} from 'react-router-dom';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import navbar from './components/navbar'
import loginpage from "./components/loginpage";
import SignUp from "./components/signup";
import {Nav,NavDropdown,Navbar,Form,FormControl,Button} from 'react-bootstrap';


function App(){
  return (
    <>
      <Navbar bg="light" expand="lg">
        <Navbar.Brand ><Link to="/">Addjency</Link></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Link to="/signin">Sign In</Link>
          <Link to="/">Sign Up</Link>
          <NavDropdown title="Dropdown" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-success">Search</Button>
        </Form>
        </Navbar.Collapse>
    </Navbar>
    <Switch>
      <Route path="/" Component={SignUp} exact></Route>
      <Route path="/signin" Component={loginpage}></Route>
    </Switch>
  </>

  );
}
export default App;
